DELIMITER $$
CREATE TRIGGER `BI_Orders` BEFORE INSERT ON `orders` FOR EACH ROW BEGIN
    
    DECLARE x INT;
    SET x := 0;
    
    Select count(*) 
      into  x
      from wallet_management 
     where customer_id = NEW.user_id 
       and ride_status = 0;
    if x > 0 then
       SET NEW.wallet_flag := 'Y';
    else
       SET NEW.wallet_flag := 'N';
    end if;
    
    END
$$
