DELIMITER $$
CREATE TRIGGER `AI_Wallet_Utilized` AFTER INSERT ON `wallet_utilized` FOR EACH ROW BEGIN

    declare x INT;
    SET x := 0;
    
    UPDATE WALLET_MANAGEMENT
       SET USED_RIDES = NVL(USED_RIDES,0) + 1
     WHERE CUSTOMER_ID = NEW.CUSTOMER_ID
       AND nvl(USED_RIDES,0) < nvl(NO_OF_RIDES,0)
       AND RIDE_STATUS = 0;

    UPDATE WALLET_MANAGEMENT
       SET RIDE_STATUS = 1
     WHERE CUSTOMER_ID = NEW.CUSTOMER_ID
       AND nvl(USED_RIDES,0) >= nvl(NO_OF_RIDES,0)
       AND RIDE_STATUS = 0;
end
$$
